INSERT INTO `apm_profile` (`id_profile`, `title`, `content`, `path`) VALUES
(1, 'CV. WANAMMI', 'CV Wanammi berdiri pada bulan April tahun 2014 dan bermula di bidang hasil pertanian. Perkebunan milik CV Wanammi yang terletak di salabintana, sukabumi ini mengembangkan tanaman sayuran organik, buah-buahan, dan tanaman hias. \r\n\r\nPada tahun 2008, CV Wanammi melakukan perdagangan hasil pertanian serta mengembangkan jasa konsultasi di bidang pangan dan gizi.\r\n\r\n Pada tahun 2011, CV Wanammi bergerak pada bidang pemasok bahan makanan ke perusahaan catering dan restoran dan tetap mengembangkan bidang konsultasi pangan dan gizi. Akhir tahun 2012, kami mulai bergerak dalam pelayanan jasa boga yakni catering dengan mengutamakan gizi seimbang, variasi menu dan keamanan pangan.\r\n', 'b38d301bb9560704cd79bc700549e8c3.png');
